import React, { useRef } from "react";
import { motion, useInView } from "framer-motion";
import { FaCode, FaServer, FaMobile, FaDatabase, FaTools } from 'react-icons/fa';

const Skills = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  // Enhanced skills data with proficiency levels (0-100)
  const skills = [
    // Frontend
    { name: 'HTML5', level: 90, category: 'Frontend', icon: 'üî∑', color: 'from-blue-500 to-cyan-500' },
    { name: 'CSS3', level: 85, category: 'Frontend', icon: 'üé®', color: 'from-purple-500 to-pink-500' },
    { name: 'JavaScript', level: 88, category: 'Frontend', icon: 'üìú', color: 'from-yellow-500 to-orange-500' },
    { name: 'React.js', level: 85, category: 'Frontend', icon: '‚öõÔ∏è', color: 'from-cyan-500 to-blue-500' },
    { name: 'Tailwind CSS', level: 90, category: 'Frontend', icon: 'üí®', color: 'from-sky-500 to-blue-600' },
    // Backend
    { name: 'Node.js', level: 82, category: 'Backend', icon: 'üü¢', color: 'from-green-500 to-emerald-500' },
    { name: 'Python', level: 85, category: 'Backend', icon: 'üêç', color: 'from-yellow-400 to-blue-500' },
    { name: 'Django', level: 78, category: 'Backend', icon: 'üéØ', color: 'from-green-600 to-emerald-500' },
    // Database
    { name: 'MongoDB', level: 80, category: 'Database', icon: 'üçÉ', color: 'from-green-400 to-emerald-600' },
    { name: 'PostgreSQL', level: 78, category: 'Database', icon: 'üêò', color: 'from-blue-400 to-indigo-600' },
  ];

  // Animation variants
  const container = {
    hidden: { opacity: 0 },
    show: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
      },
    },
  };

  const item = {
    hidden: { opacity: 0, y: 20 },
    show: { opacity: 1, y: 0, transition: { duration: 0.5 } },
  };

  return (
    <section id="skills" className="relative py-20 overflow-hidden bg-gradient-to-br from-gray-50 to-blue-50 dark:from-dark-900 dark:to-dark-800">
      {/* Animated Background */}
      <div className="absolute inset-0 overflow-hidden">
        <div className="absolute top-1/4 -left-20 w-96 h-96 bg-purple-200 dark:bg-purple-900/30 rounded-full mix-blend-multiply filter blur-3xl opacity-70 animate-blob"></div>
        <div className="absolute top-1/2 -right-20 w-96 h-96 bg-blue-200 dark:bg-blue-900/30 rounded-full mix-blend-multiply filter blur-3xl opacity-70 animate-blob animation-delay-2000"></div>
      </div>

      <div className="container-custom relative z-10 px-4 sm:px-6">
        {/* Section Header */}
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16 max-w-3xl mx-auto"
        >
          <motion.span 
            className="inline-block text-sm font-medium text-primary-600 dark:text-primary-400 mb-4 px-4 py-1.5 rounded-full bg-primary-50 dark:bg-primary-900/30"
            initial={{ opacity: 0, y: 10 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 0.2 }}
          >
            My Expertise
          </motion.span>
          <motion.h2 
            className="text-4xl md:text-5xl font-bold text-dark-900 dark:text-white mb-4"
            initial={{ opacity: 0, y: 10 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 0.3 }}
          >
            Technical <span className="text-transparent bg-clip-text bg-gradient-to-r from-blue-600 to-cyan-500">Skills</span>
          </motion.h2>
          <motion.p 
            className="text-lg text-dark-600 dark:text-dark-400"
            initial={{ opacity: 0, y: 10 }}
            animate={inView ? { opacity: 1, y: 0 } : {}}
            transition={{ duration: 0.6, delay: 0.4 }}
          >
            Technologies I've worked with to build amazing digital experiences
          </motion.p>
        </motion.div>

        {/* Skills Grid */}
        <motion.div 
          className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-5 gap-6"
          variants={container}
          initial="hidden"
          animate={inView ? "show" : "hidden"}
        >
          {skills.map((skill, index) => (
            <motion.div 
              key={skill.name}
              className="group relative"
              variants={item}
            >
              <div className="h-full bg-white/80 dark:bg-dark-700/80 backdrop-blur-sm rounded-2xl p-6 shadow-lg hover:shadow-xl transition-all duration-300 border border-gray-100 dark:border-dark-600 hover:border-transparent">
                {/* Skill Icon */}
                <div className={`w-14 h-14 rounded-xl ${skill.color.split(' ')[0]} ${skill.color.split(' ')[1]} flex items-center justify-center text-2xl mb-4 mx-auto`}>
                  {skill.icon}
                </div>

                {/* Skill Name */}
                <h3 className="text-xl font-bold text-center text-dark-900 dark:text-white mb-3">
                  {skill.name}
                </h3>

                {/* Progress Bar */}
                <div className="w-full bg-gray-200 dark:bg-dark-600 rounded-full h-2.5 mb-4">
                  <div 
                    className={`h-full rounded-full ${skill.color} transition-all duration-1000 ease-out`}
                    style={{ width: `${skill.level}%` }}
                  ></div>
                </div>

                {/* Skill Level */}
                <div className="flex justify-between text-xs text-gray-500 dark:text-gray-400 mb-2">
                  <span>Proficiency</span>
                  <span className="font-medium">{skill.level}%</span>
                </div>

                {/* Category Badge */}
                <div className="inline-block px-3 py-1 text-xs font-medium rounded-full bg-gray-100 dark:bg-dark-600 text-gray-800 dark:text-gray-200 mt-3">
                  {skill.category}
                </div>
              </div>

              {/* Hover Effect */}
              <div className={`absolute inset-0 rounded-2xl opacity-0 group-hover:opacity-20 transition-opacity duration-300 ${skill.color} blur-2xl -z-10`}></div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
